import img1 from '../shop-image/1.png';
import img2 from '../shop-image/5.png';
import img3 from '../shop-image/4.png';
import img4 from '../shop-image/3.png';
import img5 from '../shop-image/2.png';
import img6 from '../shop-image/6.png';


export const PRODUCTS = [
    { id: 1, name: 'T-shirt', price: 25, image: img1 },
    { id: 2, name: 'Patch', price: 10, image: img2 },
    { id: 3, name: 'Cap', price: 20, image: img3 },
    { id: 4, name: 'Bandana', price: 15, image: img4 },
    { id: 5, name: 'Bag', price: 20, image: img5 },
    { id: 6, name: 'Socks', price: 20, image: img6 }
];
